from sympy import isprime
def ok(n):
    if n < 2 or n%10 not in {1, 3, 7, 9} or isprime(n): return False
    s = str(n)
    return all(isprime(int(s[:i] + '5' + s[i:])) for i in range(len(s)))
print(list(filter(ok, range(5698)))) # _Michael S. Branicky_, Sep 21 2021

